document.addEventListener("DOMContentLoaded",function(){setTimeout(function(){document.body.classList.remove("is-fading-in")},500);for(var e=document.querySelectorAll('a[href^="/"]'),t=0;t<e.length;t++)e[t].addEventListener("click",function(e){if(!(e.shiftKey||e.ctrlKey||e.altKey||e.metaKey)){e.preventDefault(),document.body.classList.add("is-fading-out");var t=this.href;setTimeout(function(){window.location=t},500)}});document.getElementById("js-mobile-nav-toggle").addEventListener("click",function(){this.classList.toggle("is-active"),this.nextSibling.classList.toggle("is-active")})}),document.onreadystatechange=function(){if("interactive"===document.readyState)for(var e=document.querySelectorAll("iframe"),t=0;t<e.length;t++)e[t].style.opacity=0,e[t].addEventListener("load",function(e){this.classList.add("is-fading-in"),this.style.animationDuration=".6s"});"complete"===document.readyState&&"undefined"!=typeof FB&&FB.Event.subscribe("xfbml.render",function(e){for(var t=document.querySelectorAll(".fb_iframe_widget iframe"),n=0;n<t.length;n++)t[n].classList.add("is-fading-in"),t[n].style.animationDuration="1s"})};